import React from "react";

function Navbar() {
  return (
    <nav className="flex justify-between items-center bg-gray-800 text-white p-4 py-8">
      <div className="text-xl font-bold">Expense Tracker</div>
      <div>
        <a href="/login" className="mx-8 text-xl hover:text-gray-500">
          Login
        </a>
        <a href="/signup" className="mx-8 text-xl hover:text-gray-500">
          Sign Up
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
